import * as React from "react";
import Box from "@mui/material/Box";
import BottomNavigation from "@mui/material/BottomNavigation";
import BottomNavigationAction from "@mui/material/BottomNavigationAction";
import RestoreIcon from "@mui/icons-material/Restore";
import FavoriteIcon from "@mui/icons-material/Favorite";
import LocationOnIcon from "@mui/icons-material/LocationOn";
import { styled } from "@mui/material/styles";
import "./styles.css";
const MyBottomNavigation = styled(BottomNavigation)({
  backgroundColor: "#8A22F1",
  borderRadius: 15,
});

const MyBottomNavigationAction = styled(BottomNavigationAction)({
  color: "white",
  "&:hover": {
    transform: "scale(1.1)",
  },
  "&.Mui-selected": {
    transform: "scale(1.01)",
    backgroundColor: "#C592F8",
  },
  "&.Mui-selected .MuiBottomNavigationAction-iconOnly": {
    color: "white",
  },
});

export default function Navbar() {
  const [value, setValue] = React.useState(0);

  return (
    <Box
      sx={{
        width: "100%",
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
        position: "absolute",
        bottom: 30,
      }}
    >
      <MyBottomNavigation
        showLabels
        value={value}
        onChange={(event, newValue) => {
          setValue(newValue);
        }}
      >
        <MyBottomNavigationAction
          disableRipple
          label="Recents"
          icon={<RestoreIcon />}
        />
        <MyBottomNavigationAction label="Favorites" icon={<FavoriteIcon />} />
        <MyBottomNavigationAction label="Nearby" icon={<LocationOnIcon />} />
        <MyBottomNavigationAction label="Nearby" icon={<LocationOnIcon />} />
        <MyBottomNavigationAction label="Nearby" icon={<LocationOnIcon />} />
      </MyBottomNavigation>
    </Box>
  );
}
